import React from 'react';
import { Layout, Row, Col, Anchor, Button, Menu, Dropdown, Space } from 'antd';
import './styles.css';
import HeaderIconButton from '../../assets/images/headers/vietnamese.svg'
const { Header, Footer, Sider, Content } = Layout;
const { Link } = Anchor;
import { DownOutlined, SmileOutlined } from '@ant-design/icons';

const HomeComponent = () => {
    const menu = (
        <Menu
          items={[
            {
              key: '1',
              label: (
                <a target="_blank" rel="noopener noreferrer" href="https://www.antgroup.com">
                  1st menu item
                </a>
              ),
            },
            {
              key: '2',
              label: (
                <a target="_blank" rel="noopener noreferrer" href="https://www.aliyun.com">
                  2nd menu item (disabled)
                </a>
              ),
              icon: <SmileOutlined />,
              disabled: true,
            },
            {
              key: '3',
              label: (
                <a target="_blank" rel="noopener noreferrer" href="https://www.luohanacademy.com">
                  3rd menu item (disabled)
                </a>
              ),
              disabled: true,
            },
            {
              key: '4',
              danger: true,
              label: 'a danger item',
            },
          ]}
        />
      );
    return (
        <Layout>
            <Header className="header">
                <Row>
                    <Col span={4}>Logo</Col>
                    <Col span={20} style={{ display: 'flex', justifyContent: 'end' }}>
                        <div style={{ marginRight: '10px'}}>
                            <Anchor>
                                <Link className="header__ref">
                                    <div>
                                        <span className="gry-text">LINK GIỚI THIỆU</span>
                                        <p className="link-ref">olacity.com/ref/658372480</p>
                                    </div>
                                    <div>
                                        <strong className="copy">Sao chép</strong>
                                    </div>
                                </Link>
                            </Anchor>
                        </div>
                        <div className="align-items-center">
                            <Button >
                                <img className="dropdown-item-icon" src={HeaderIconButton} alt='img'/>
                            </Button>
                            <Button style={{ marginLeft:'10px' }}>
                                VNĐ
                            </Button>
                        </div>
                        <div className="items-message">

                        </div>
                    </Col>
                </Row>
            </Header>
            <Layout>
                <Sider className="sider">Sider</Sider>
                <Content>Content</Content>
            </Layout>
            <Footer>Footer</Footer>
        </Layout>

    );
}

export default HomeComponent;
